import React,{Component} from 'react';
import {
    HomeWidget,
    HomeLeftWidget,
    HomeRightWidget
} from './style';

class Home extends Component{
    render(){
        return (
            <HomeWidget>
                <HomeLeftWidget>
                    <img className='HomeImg' src='https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1555653921903&di=dd747deaf54c86c6b0b939353f4675e9&imgtype=0&src=http%3A%2F%2Fhbimg.b0.upaiyun.com%2F7821152e3d96c21c60b8a29267f9d91611baed4beaae9-5lIvtV_fw658' alt='' />
                </HomeLeftWidget>
                <HomeRightWidget></HomeRightWidget>
            </HomeWidget>
        )
    }
}   
export default Home;
